import React from 'react';
import { List, Grid, Segment, Container, Header, Icon } from 'semantic-ui-react'

const Footer = () => {

    return (
        <Segment vertical style={{ padding: '1em' }}>
            <Segment placeholder>
                <Header icon>
                    <Icon name='search' />
                        We don't have any documents matching your query.
                </Header>
                <Segment.Inline>
                    <Button primary>Clear Query</Button>
                    <Button>Add Document</Button>
                </Segment.Inline>
            </Segment>
        </Segment>
    )
}

export default Footer;
